Dark Dimensions: Somber Song Collector's Edition


Genre: Adventure | Hidden Object | Puzzle


You've traveled across the country, tracking down dark dimensions in search of your missing family, when you stumble upon a violent one that has taken over the city of Seven Oaks, North Dakota. The black smoke is chasing people and captured a young girl right in front of your eyes. What caused this dark dimension, and who is being controlled by its influences? You must investigate for the truth behind the town's recent tragedy if you want to save its future. A friendly spirit may help you, but can you trust him? Free the people and save the town in this exciting hidden-object puzzle adventure


This is a special Collector's Edition release full of exclusive extras you won't find in the standard version.


